  //zeigt, welches Rezept angezeigt wird/werden soll
  const [selectedRecipe, setSelectedRecipe] = useState(null);
  let testarray = [recipeData[0].title];
  console.log(testarray);
  let random = testarray[Math.floor(Math.random() * testarray.length)];

  return (
    <>
      <Header title="Randomizer" />
      <h3> randomizer site </h3>
      <h3> {random} </h3>
    </>
  );
}
